          </div>
          <div className={`md:flex ${isOpen ? 'block' : 'hidden'}`}>
            <ul className="md:flex space-x-4 ">
              <li>
                <button href="#" className="text-white button ">Home</button>
              </li>
              <li>
                <button href="#" className="text-white button ">projects</button>
              </li>
              <li>
                <button href="#" className="text-white button ">about me</button>
              </li>
              <li>
                <button href="#" className="text-white button ">contact</button>
              </li>

            </ul>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
